}

export default function TodoList(props) {
    return (
        <ul style={styles.ul}>
            {/* { props.books.map(todo => {
                return TodoItem
            })} */}
            <TodoItem/>
            <TodoItem/>
            <TodoItem/>
        </ul>
    )
}
